import React from "react";
import BloqueCarrito from "../../componentes/BloqueCarrito";
import Footer from "../../componentes/Footer";
import "../../hojas-de-estilo/Carrito.css";

function Carrito() {
  return (
    <div className="shopcar-container">
      <div>
        <BloqueCarrito />
        <div>
          <p>Total</p>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Carrito;
